import React from 'react';
import PropTypes from 'prop-types';
import './Hexagon.css'; 

const Hexagon = () => {
  return (
    <div className="hex">
      <div className="top"></div>
      <div className="middle"></div>
      <div className="bottom"></div>
    </div>
  );
};

export default Hexagon;
